import React from 'react';
import './App.css';
import {Provider} from 'react-redux';
import store from './store';
import {Increaser, Decreaser, Setter, Resetter} from './component/Counter'

function App() {
  return (
    <Provider store= {store}>
      <div className = 'counter'>
        <Increaser/>
        <Decreaser/>
        <Setter/>
        <Resetter/>
      </div>
      <div className = 'tagCounter'>
        <AddTag/>
        <RemoveTag/>
        <AddTags/>
      </div>

    </Provider>
  );
}

export default App;
